import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <form>
            <label>
              Please tell us about yourself:
            </label><br/>

            <input id="firstName" type="text" placeholder="First name"></input><br/>
            <input id="lastName" type="text" placeholder="Last name"></input><br/>
            <input id="age" type="number" placeholder="Age"></input><br/>
            <input id="email" type="email" placeholder="Email address"></input><br/>

            <select multiple="true">
              <option value="realEstate">Real Estate</option>
              <option value="franchising">Franchising</option>
              <option value="contentCreation">Content Creation</option>
            </select><br/>
          </form>
        </header>
      </div>
    );
  }
}

export default App;
